         alert(`data sent ${JSON.stringify(textData)} `);
          fetch("http://localhost:9000/patient/updateExam",{
          method:"POST",
          crossDomain:true,
          headers:{
          "content-type":"application/json",
          Accept:"application/json",
          "Access-Control-Allow-Origin":"*",
          },
            body: JSON.stringify(textData),
          })
         }
      }
}

